    const handleNum = async () => {
        try {
            const res = await axios.get(`http://localhost:3000/JXH/jaddlist`);
            setList(res.data.data);
            // 单次遍历计算所有数值
            let num1 = 0, num2 = 0, num3 = 0;
            res.data.data.forEach(item => {
                if (item.num === '1') num1++;
                else if (item.num === '2') num2++;
                else if (item.num === '3') num3++;
            });

            // 单次状态更新
            setNums({ num1, num2, num3 });
        } catch (err) {
            console.error(err);
        }
    }
    useEffect(() => {
        handleNum();
    }, [])
    const { num1, num2, num3 } = nums

